import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';
import { isAuthenticated } from './auth';
import '../styles.css';

const ContractForm = () => {
  const [formData, setFormData] = useState({
    secretariat: '',
    contract_number: '',
    start_date: '',
    end_date: '',
    description: '',
    process_type: '',
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();
  const { id } = useParams();

  useEffect(() => {
    if (!isAuthenticated()) {
      console.log('Token não encontrado ou inválido, redirecionando para /login');
      navigate('/login');
      return;
    }

    if (id) {
      const fetchContract = async () => {
        setLoading(true);
        try {
          console.log(`Buscando contrato com ID: ${id}`);
          const response = await axios.get(`http://192.168.1.110:5000/api/contracts/${id}`, {
            headers: {
              Authorization: `Bearer ${localStorage.getItem('token')}`,
            },
          });
          console.log('Contrato carregado:', JSON.stringify(response.data, null, 2));
          setFormData(response.data);
          setError('');
        } catch (err) {
          console.error('Erro ao carregar contrato:', {
            message: err.message,
            response: err.response?.data,
            status: err.response?.status,
          });
          if (err.response?.status === 401) {
            console.log('Erro 401: Token inválido, redirecionando para /login');
            localStorage.removeItem('token');
            navigate('/login');
          } else {
            setError(err.response?.data?.error || 'Erro ao carregar contrato');
          }
        } finally {
          setLoading(false);
        }
      };
      fetchContract();
    }
  }, [id, navigate]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    try {
      console.log('Enviando dados do contrato:', JSON.stringify(formData, null, 2));
      if (id) {
        await axios.put(`http://192.168.1.110:5000/api/contracts/${id}`, formData, {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        console.log('Contrato atualizado com sucesso');
      } else {
        await axios.post('http://192.168.1.110:5000/api/contracts', formData, {
          headers: {
            Authorization: `Bearer ${localStorage.getItem('token')}`,
          },
        });
        console.log('Contrato criado com sucesso');
      }
      navigate('/contracts');
    } catch (err) {
      console.error('Erro ao salvar contrato:', {
        message: err.message,
        response: err.response?.data,
        status: err.response?.status,
      });
      if (err.response?.status === 401) {
        console.log('Erro 401: Token inválido, redirecionando para /login');
        localStorage.removeItem('token');
        navigate('/login');
      } else {
        setError(err.response?.data?.error || 'Erro ao salvar contrato');
      }
    }
  };

  return (
    <div className="form-container">
      <h2>{id ? 'Editar Contrato' : 'Novo Contrato'}</h2>
      {error && <p className="error-message">{error}</p>}
      {loading && <div className="spinner">Carregando...</div>}
      <form onSubmit={handleSubmit} className="contract-form">
        <div className="form-group">
          <label>Secretaria:</label>
          <input
            type="text"
            name="secretariat"
            value={formData.secretariat}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Nº do Contrato:</label>
          <input
            type="text"
            name="contract_number"
            value={formData.contract_number}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Data de Início:</label>
          <input
            type="date"
            name="start_date"
            value={formData.start_date}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Data de Término:</label>
          <input
            type="date"
            name="end_date"
            value={formData.end_date}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Descrição:</label>
          <textarea
            name="description"
            value={formData.description}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Tipo de Processo:</label>
          <input
            type="text"
            name="process_type"
            value={formData.process_type}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-buttons">
          <button type="submit">Salvar</button>
          <button type="button" onClick={() => navigate('/contracts')}>
            Cancelar
          </button>
        </div>
      </form>
    </div>
  );
};

export default ContractForm;
